import React from 'react';
import {getImg} from "../utils/helper";

export const CartListProduct = props => {
    const productKey = this.props.newBoxs.id;
    const findKey = this.props.newBoxs.find(el => el.image.includes(productKey));

    return (
        <div className='box-light-cart-list'>
            { getImg(findKey.image) } 
            <span>
                { findKey.name }
            </span>
            <input type={"text"} className="input-counter-cart-list" defaultValue={ findKey.num } onChange={props.onChangeValue}/>
            <span>
                { findKey.price }
            </span>
            <button className="btn main-btn-remove">remove</button>
        </div>
    );
}
